'use strict';
let DxFeedHeartbeatData = require('./DxFeedHeartbeatData.js');
let jsonNode = require('@gehtsoft/LuaxStdlib-node').jsonNode;
class DxFeedHeartbeatDataReader {
    read(node) {
        let error, successful;
        if (node.getPropertyByName("channel").getValueAsString() != DxFeedHeartbeatData.CHANNEL) {
            return null;
        }
        error = null;
        successful = true;
        if (node.getPropertyByName("successful").getType() != jsonNode.NIL) {
            successful = node.getPropertyByName("successful").getValueAsBoolean();
        }
        if (!successful) {
            error = node.getPropertyByName("error").getValueAsString();
        }
        return DxFeedHeartbeatData.create(successful, error);
    }
}
module.exports = DxFeedHeartbeatDataReader
